import React, { useState, useContext } from "react";
import { GlobalState } from "../../GlobalState";
import Menu from "./icons/menu.svg";
import Cart from "./icons/cart.svg";
import Close from "./icons/close.svg";
import { Link } from "react-router-dom";
import { Container, Nav, Navbar } from "react-bootstrap";

export default function Header() {
  const value = useContext(GlobalState);
  return (
    <header>
      <Navbar bg="light" variant="light" expand="lg">
        <Container style={{margin: 0, maxWidth: "100%"}}>
          <Navbar.Toggle aria-controls="responsive-navbar-nav" />
          <Navbar.Collapse id="responsive-navbar-nav">
            <Navbar.Brand className="ml-auto" href="/">
              FallMart
            </Navbar.Brand>
            <Nav className="ms-auto justify-content-end customClass">
              <Nav.Link href="/">Products</Nav.Link>
              <Nav.Link href="/login">Login or Register</Nav.Link>
              <Nav.Item><img src={Cart} alt="Cart" width="30"></img></Nav.Item>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>
    </header>
  );
}
